import http from "./http-common";
class DataService {
  create(data) {
    //return http.get("/simulado", data);
    return http.post("/simulado",{
      tempoInvestimento: data.tempoInvestimento,
      investimentoInicial: data.investimentoInicial,
      checkedInvestimentos: data.checkedInvestimentos
    });
  }

  retrieve(){
    return http.get("/");
  }

  teste(){
    return http.post("/teste");
  }
}
export default new DataService();
